import { Button, Container, Grid, makeStyles, TextField, Typography } from '@material-ui/core';
import { FC } from 'react';
import { Header } from '../components/Header';

const useStyles = makeStyles((theme) => ({
  image: {
    maxHeight: '100%',
    minWidth: '100%',
    objectFit: 'cover',
    verticalAlign: 'bottom',
  },
  imageContainer: {
    display: 'flex',
    height: '25vh',
    flexGrow: 1,
  },
  title: {
    marginTop: '2rem',
  },
  subtitle: {
    marginTop: '0.5rem',
    marginBottom: '1rem',
    color: theme.palette.grey[600],
  },
}));

const Home: FC = () => {
  const classes = useStyles();

  return (
    <>
      <Header />
      <div className={classes.imageContainer}>
        <img
          src="https://images.unsplash.com/photo-1521295121783-8a321d551ad2?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=800&q=60"
          alt="wannabi.in"
          className={classes.image}
        />
      </div>
      <Container maxWidth="md">
        <Grid container>
          <Grid item xs={12}>
            <Typography variant="h3" component="h1" className={classes.title}>
              We all dream of being in other places
            </Typography>
          </Grid>
          <Grid item xs={12}>
            <Typography variant="subtitle1" className={classes.subtitle}>
              What is the place where you would rather be?
            </Typography>
          </Grid>
          <Grid item xs={12}>
            <Grid container>
              <Grid item xs={8}>
                <TextField id="search" label="Search" variant="filled" required fullWidth />
              </Grid>
              <Grid item xs={4}>
                <Button>Search</Button>
              </Grid>
            </Grid>
          </Grid>
        </Grid>
      </Container>
    </>
  );
};

export default Home;
